import React from 'react';
import FormPropsTextFields from './TickerTextBox.js'
import ReactApexChart from 'react-apexcharts';
class IncomeStatementsTable extends React.Component {
	update(e) {
		this.props.changepricingSeries(e.target.pricingSeries);
		this.props.pricingOptions(e.target.pricingOptions);
    }
	render() {
		return (
			<div>
			<div>
			<FormPropsTextFields parentCallback = {this.handleCallback}/>
			</div>
			<div id="chart" >
			<ReactApexChart options={this.state.options} series={this.state.series} type="candlestick" />
			</div>
			</div>
		);
	}
}
export default IncomeStatementsTable;
